import React,{useState,useEffect} from "react";
import {json, useNavigate} from "react-router-dom";



var myObject;
function handleResponse(){
  console.log(" Handling Response");
  fetch("http://localhost:8081/").then((res)=>res.json())
  .then((json)=>{
    console.log(json);

    const valuesArray=json
    var myObject=    valuesArray
    // myObject= JSON.parse(json);
    console.log(myObject);

  })
  return(myObject)
}

function PersonalPage(){
    const [passengerName,setpassengerName]= useState();
    const [age,setage]= useState();
    const [email,setemail]= useState();
    const [busses,setBusses]=useState({});

    const navigate=useNavigate();
    useEffect(()=>{

      setBusses(handleResponse())
    },[])

    const personalPageSubmit = event => {
        event.preventDefault(); 

        console.log('personalPageSubmit done');
        navigate("confirmationpage");

    };
console.log(busses)
    return(

      <>

      <div className='Place'>
        <h2>
          Destination Details
        </h2>
        <select className="PlaceNames">
          <option value="1">{busses?.bus1?.number}</option>
          <option value="2">{busses?.bus2?.number}</option>
          <option value="3">{busses?.bus3?.number}</option>
          <option value="4">{busses?.bus4?.number}</option>

        </select>
      </div><form className='SubmitPlaces' onSubmit={personalPageSubmit}>
            <div>
            <b>Enter passenger Name     </b>
            <input
              id="passengerName"
              name="passengerName"
              type="text"
              onChange={event => passengerName(event.target.value)}
              value={passengerName} />
            </div>
            <div>
            <b>Enter age of passenger    </b>
            <input
              id="age"
              name="age"
              type="text"
              onChange={event => age(event.target.value)}
              value={age} />
               </div>
               <div>
             <b>Enter your E-mail id    </b>


            <input
              id="email"
              name="email"
              type="text"
              onChange={event => email(event.target.value)}
              value={email} />
            </div>

          <button type='submit'> Submit</button>
        </form></>
    )

}
export default PersonalPage;
